import React from 'react';
import { Box, Container, Toolbar, Typography } from '@mui/material';

const Trends = () => {
  return (
    <>
      <Toolbar></Toolbar>

      <Container
        sx={{
          background: 'black',
          color: 'white',
          height: '100vh',
          width: '100%',
          pt: 5,
          display: 'flex',
          // justifyContent: 'center',
          alignItems: 'center',
          flexDirection: 'column',
        }}>
        <Box>
          <Typography>Trending </Typography>
        </Box>
      </Container>
    </>
  );
};

export default Trends;
